import React from 'react'
import Home from './Home/Home'
import HomeBooks from './Home/HomeBooks'

const HomePage = props => {
    return (
        <div className='px-[10%]'>
            <Home />
            <HomeBooks />
        </div>
    )
}

HomePage.propTypes = {}

export default HomePage
